import logo from './logo.svg';
import './App.css';
import {useState} from 'react'; 
import {Routes, Route, Link, useNavigate} from 'react-router-dom';
import data from './data';
import data2 from './data2';
import MainShowCase from './component/MainShowCase';
import Detail from './component/Detail';
import Footer from './component/Footer';


function App() {

  let [pang, setPang] = useState(data);
  let [pang2,setPang2] = useState(data2);
  let navigate = useNavigate();

  return (
    <div>
      <div className="navContainer">
        <div className='innerNav'>
          <p className="home" onClick={()=>{navigate("/")}}>놀부네 빵앗간</p>
          <ul>
            <li>로그인</li>
            <li>회원가입</li>
            <Link className='menuList' to="/cart"><li>장바구니</li></Link>
          </ul>
          <img className="hamburger" src={process.env.PUBLIC_URL + "/menu.png"}/>
        </div>
      </div>
      <div className="main-bg"></div>

      <Routes>
        <Route path="/" element={<div><MainShowCase pang={pang} pang2={pang2} setPang={setPang} setPang2={setPang2} /></div>} />
        <Route path="/detail/:id" element={<div><Detail pang={pang} pang2={pang2} setPang={setPang} setPang2={setPang2} /></div>} />
        <Route path="*" element={<div>해당 페이지를 찾을 수 없습니다.</div>} />
      </Routes>

      <button onClick={()=>{
          let copy = [...pang, ...pang2];

          console.log(pang);
        }}>더보기111</button>

      <Footer />
    </div>
  );
}

export default App;
